import React from "react";
import { Link } from "react-router-dom";
import classes from "./MainNavigation.module.css";

const MainNavigation = () => {
    return (
        <header>
            <div>
                React MeetUps
            </div>
            <nav>
                <ul>
                    <li>
                        <Link to='/' >
                            All Meeetups
                        </Link>
                        <Link to='/Favourites' >
                            Favourites
                        </Link>
                        <Link to='/NewMeetups' >
                            New MeetUps
                        </Link>
                    </li>
                </ul>
            </nav>
        </header>
    );
}
export default MainNavigation;
